Question: Let
\[f(x) = \left\{
\begin{array}{cl}
x + 3 & \text{if $x < 20$}, \\
2x - 2 & \text{if $x \ge 20$}.
\end{array}
\right.\]Find $f^{-1}(7) + f^{-1}(46).$
Answer:

output:
The inverse of $f$ is
\[f^{-1}(x) = \left\{
\begin{array}{cl}
x - 3 & \text{if $x < 20$}, \\
\frac{x + 2}{2} & \text{if $x \ge 20$}.
\end{array}
\right.\]

Thus, $f^{-1}(7) = 4$ and $f^{-1}(46) = 23$.  Thus, $f^{-1}(7) + f^{-1}(46) = \boxed{27}.$ The answer is: 27

