Answer:

output:
The law of cosines states that $c^2 = a^2 + b^2 - 2ab \cos C$.  Thus, $C = \cos^{-1}\left(\frac{a^2 + b^2 - c^2}{2ab}\right)$.  In this case, $C = \cos^{-1}\left(\frac{6^2 + 5^2 - 4^2}{2 \cdot 6 \cdot 5}\right) = \cos^{-1}\left(\frac{1}{10}\right) = \frac{\pi}{6}.$

The law of sines states that $\frac{a}{\sin A} = \frac{b}{\sin B} = \frac{c}{\sin C}$.  Thus, $\frac{a}{\sin A} = \frac{b}{\sin B} = \frac{c}{\sin C} = \frac{6}{\sin \frac{\pi}{6}} = \frac{5}{\sin \frac{\pi}{6}} = \frac{4}{\sin \frac{\pi}{6}}.$

Thus, $\frac{\cos \frac{A - B}{2}}{\sin \frac{C}{2}} - \frac{\sin \frac{A - B}{2}}{\cos \frac{C}{2}} = \frac{\cos \frac{\pi}{6}}{\sin \frac{\pi}{6}} - \frac{\sin \frac{\pi}{6}}{\cos \frac{\pi}{6}} = \frac{\sqrt{3}}{3} - \frac{1}{2} = \boxed{\frac{1}{6}}.$ The answer is: \frac{1}{6}

