Question: Determine the number of integers $x$ such that $0\le x< 12$ and $x$ satisfies the following system of equations: \begin{align*}
&x-1\equiv 1-x\pmod {12},\\
&x-2\equiv 2-x\pmod{12}.
\end{align*}
Answer:

output:
The matrix is
\[\begin{pmatrix} 0 & 2 & -1 \\ 3 & 0 & -3 \\ 1 & 4 & -5 \end{pmatrix} \begin{pmatrix} 3 \\ 2 \\ 2 \end{pmatrix} = \begin{pmatrix} 0(3) + 2(2) - 1(2) \\ 3(3) + 0(2) - 3(2) \\ 1(3) + 4(2) - 5(2) \end{pmatrix} = \begin{pmatrix} 0 \\ 3 \\ 1 \end{pmatrix}.\]
The answer is: \begin{pmatrix} 0 \\ 3 \\ 1 \end{pmatrix}

