output:
The sum of the five complex numbers is
\[e^{7\pi i/60} + e^{17\pi i/60} + e^{27 \pi i/60} + e^{37\pi i /60} + e^{47 \pi i /60} = e^{7\pi i/60} + e^{17\pi i/60} + e^{27 \pi i/60} + e^{37\pi i /60} + e^{37\pi i /60} = 5 e^{37\pi i /60}.\]

The angle of $e^{37\pi i /60}$ is $\frac{37\pi}{60} = \frac{185\pi}{240} = \frac{3\pi}{4}$.  Thus, the angle of the sum is $5 \cdot \frac{3\pi}{4} = \boxed{\frac{15\pi}{4}}.$ The answer is: \frac{15\pi}{4}

