output:
The area of a triangle is $\frac{1}{2}ab\sin C$.  Thus the ratio of the areas of the two triangles is
\[\frac{\frac{1}{2}5\cdot 12\sin C}{\frac{1}{2}8\cdot 15\sin D} = \frac{60\sin C}{120\sin D}.\]

Since the two triangles have the same angle $C=D$, we have $\sin C = \sin D$.  Thus the ratio of the areas of the two triangles is $\boxed{\frac{60}{120}} = \boxed{\frac{1}{2}}.$ The answer is: \frac{1}{2}

