$\tan 20^\circ = \frac{\sin 20^\circ}{\cos 20^\circ} = \frac{\sin 20^\circ}{\sqrt{1 - \sin^2 20^\circ}} = \frac{\sin 20^\circ}{\sqrt{1 - \frac{1}{4}}}.$

Thus, $\tan 20^\circ + 4 \sin 20^\circ = \frac{\sin 20^\circ}{\sqrt{1 - \frac{1}{4}}} + 4 \sin 20^\circ = \frac{\sin 20^\circ}{\sqrt{3}} + 4 \sin 20^\circ = \frac{\sqrt{3} + 4 \sqrt{3}}{3} = \frac{7 \sqrt{3}}{3}.$

Thus, $\tan 20^\circ + 4 \sin 20^\circ = \boxed{\frac{7 \sqrt{3}}{3}}.$ The answer is: \frac{7 \sqrt{3}}{3}

