The system of equations is
\begin{align*}
3x+y&=a,\\
2x+5y&=2a.
\end{align*}
Subtracting the first equation from the second, we find $3y=a$.  Thus, $y=\frac{a}{3}$.  Substituting this into the first equation, we find $3x+\frac{a}{3}=a$, or $3x=2a$.  Thus, $x=\frac{2a}{3}$.  Substituting this into the second equation, we find $2\left(\frac{2a}{3}\right)+5\left(\frac{a}{3}\right)=2a$, or $4a+5a=6a$, or $a=\boxed{\frac{3}{5}}.$ The answer is: \frac{3}{5}

