The numerator of the first fraction is $3 + 5i$, and the numerator of the second fraction is $3 - 5i$.  The denominator of the first fraction is $3 - 5i$, and the denominator of the second fraction is $3 + 5i$.  Thus, the sum is
\[\frac{3 + 5i}{3 - 5i} + \frac{3 - 5i}{3 + 5i} = \frac{3 + 5i}{3 - 5i} + \frac{3 - 5i}{3 + 5i} = \frac{(3 + 5i)(3 + 5i)}{(3 - 5i)(3 + 5i)} + \frac{(3 - 5i)(3 - 5i)}{(3 + 5i)(3 - 5i)} = \frac{9 + 15i + 9 - 15i}{9 - 25i + 9 + 25i} = \frac{18}{34}.\]
